import js from '@eslint/js';
import pluginTypeScript from '@typescript-eslint/eslint-plugin';
import * as parserTypeScript from '@typescript-eslint/parser';
import configPrettier from 'eslint-config-prettier';
import { defineFlatConfig } from 'eslint-define-config';
import importPlugin from 'eslint-plugin-import';
import pluginPrettier from 'eslint-plugin-prettier';
import pluginVue from 'eslint-plugin-vue';
import * as parserVue from 'vue-eslint-parser';

console.log(
  '\x1B[0;37;44m INFO \x1B[0m',
  '\x1B[0;;34m ' + `读取了: eslint配置文件` + ' \x1B[0m'
);

export default defineFlatConfig([
  {
    ...js.configs.recommended,
    ...importPlugin.flatConfigs.recommended,
    ignores: [
      'node_modules',
      'pnpm-lock.yaml',
      'dist',
      'components.d.ts',
      'auto-imports.d.ts',
      'electron-dist/**/*',
      'deploy/**/*',
      '.DS_Store',
      '.eslintcache',
    ],
    languageOptions: {
      globals: {},
    },
    plugins: {
      prettier: pluginPrettier,
      import: importPlugin,
    },
    rules: {
      ...configPrettier.rules,
      ...pluginPrettier.configs?.recommended.rules,
      /**
       * 0 => off
       * 1 => warn
       * 2 => error
       */
      'no-unused-vars': 'off', // 禁止出现未使用过的变量
      'no-shadow': 'off', // 禁止变量声明与外层作用域的变量同名
      'class-methods-use-this': 'off', // 类方法如果不使用this的话会报错
      'no-console': 'off', // 此规则不允许调用console对象的方法。
      'spaced-comment': ['error', 'always', { exceptions: ['-', '+'] }], // 该规则强制注释中 // 或 /* 后空格的一致性
      'no-var': 'error', // 要求let或const代替var
      camelcase: [
        'error',
        { properties: 'never' }, // properties默认always，即检查属性名；可以设置为never，即不检查属性名
      ], // 强制执行驼峰命名约定
      'no-underscore-dangle': 'error', // 此规则不允许在标识符中使用悬空下划线。
      'no-param-reassign': 'error', // 禁止对 function 的参数进行重新赋值
      'no-nested-ternary': 'error', // 禁止嵌套三元
      'no-plusplus': 'error', // 禁用一元操作符 ++ 和 --
      'vars-on-top': 'error', // 要求所有的 var 声明出现在它们所在的作用域顶部
      'prefer-const': 'error', // 要求使用 const 声明那些声明后不再被修改的变量
      'prefer-template': 'error', // 要求使用模板字符串代替字符串连接
      'new-cap': 'error', // 要求构造函数名称以大写字母开头
      'no-restricted-syntax': [
        // 禁用一些语法
        'error',
        // 'ForInStatement',
        // 'ForOfStatement',
        {
          selector: 'ForInStatement',
          /**
           * 用 map() / every() / filter() / find() / findIndex() / reduce() / some() / ... 遍历数组，
           * 和使用 Object.keys() / Object.values() / Object.entries() 迭代你的对象生成数组。
           * 拥有返回值得纯函数比这个更容易解释
           */
          message:
            'for in会迭代遍历原型链(__proto__)，建议使用map/every/filter等遍历数组，使用Object.{keys,values,entries}等遍历对象',
        },
        {
          selector: 'ForOfStatement',
          message:
            '建议使用map/every/filter等遍历数组，使用Object.{keys,values,entries}等遍历对象',
        },
      ], // https://github.com/BingKui/javascript-zh#%E8%BF%AD%E4%BB%A3%E5%99%A8%E5%92%8C%E5%8F%91%E7%94%9F%E5%99%A8
      'no-iterator': 'error', // 禁止使用__iterator__迭代器
      'require-await': 'error', // 禁止使用不带 await 表达式的 async 函数
      'no-empty': 'error', // 禁止空块语句
      'guard-for-in': 'error', // 要求for-in循环包含if语句
      'global-require': 'error', // 此规则要求所有调用require()都在模块的顶层，此规则在 ESLint v7.0.0中已弃用。请使用 中的相应规则eslint-plugin-node：https://github.com/mysticatea/eslint-plugin-node
      'no-unused-expressions': [
        'error',
        {
          allowShortCircuit: true, // 允许短路
          allowTernary: true, // 允许三元
        },
      ], // 禁止未使用的表达式，即let a = true && console.log(1)允许，但是true && console.log(1)不行
      'object-shorthand': ['error', 'always'], // （默认）希望尽可能使用速记。var foo = {x:x};替换为var foo = {x};
      'no-useless-escape': 'error', // 禁止不必要的转义字符

      'import/order': [
        'error',
        {
          groups: [
            'builtin', // 如:import fs from 'fs';
            'external', // 如:import _ from 'lodash';
            'internal', // 如:import foo from 'src/foo';
            'parent', // 如:import foo from '../foo';
            'sibling', // 如:import bar from './bar';
            // ['sibling', 'parent'],
            // ['parent', 'sibling'],
            'index', // 如:import main from './';
            'object', // 如:import log = console.log;
            'type', // 如:import type { Foo } from 'foo';
          ],
          pathGroups: [
            {
              pattern: '@/**',
              group: 'internal',
            },
          ],
          'newlines-between': 'always', // 强制或禁止导入组之间的新行
          // 根据导入路径以字母顺序排列每个组中的顺序
          alphabetize: {
            order: 'asc', // 使用asc按升序排序，使用desc按降序排序（默认值：ignore）。
            caseInsensitive: true, // 使用true忽略大小写，而false考虑大小写（默认值：false）。
            orderImportKind: 'asc', // 使用asc以升序对各种导入类型进行排序，例如以type或typeof为前缀的导入，具有相同的导入路径。使用desc按降序排序（默认值：忽略）
          },
        },
      ],
      'import/newline-after-import': 'error', // 强制在最后一个顶级导入语句或 require 调用之后有一个或多个空行
      'import/no-extraneous-dependencies': 'error', // 禁止导入未在package.json中声明的外部模块。
    },
  },
  {
    files: ['**/*.?([cm])ts', '**/*.?([cm])tsx'],
    languageOptions: {
      parser: parserTypeScript,
      parserOptions: {
        sourceType: 'module',
      },
    },
    plugins: {
      '@typescript-eslint': pluginTypeScript,
    },
    rules: {
      ...pluginTypeScript.configs.strict.rules,

      // @typescript-eslint插件
      '@typescript-eslint/no-unused-vars': 'error',

      // '@typescript-eslint/restrict-template-expressions': [
      //   'error',
      //   {
      //     allowBoolean: true,
      //     allowNumber: true,
      //   },
      // ], // 强制模板文字表达式为string类型。即const a = {};console.log(`${a}`);会报错
      '@typescript-eslint/no-floating-promises': 'off', // 要求适当处理类似 Promise 的语句。即将await或者return Promise，或者对promise进行.then或者.catch
      '@typescript-eslint/no-explicit-any': 'off', // 不允许定义any类型。即let a: any;会报错
      '@typescript-eslint/no-non-null-assertion': 'off', // 禁止使用非空断言（后缀运算符!）。即const el = document.querySelector('.app');console.log(el!.tagName);会报错
      '@typescript-eslint/ban-ts-comment': 'off', // 禁止使用@ts-<directive>注释
      '@typescript-eslint/no-unsafe-assignment': 'off', // 不允许将具有类型的值分配any给变量和属性。即const a: any = {};const b = a;会报错
      '@typescript-eslint/no-unsafe-argument': 'off', // 不允许用any类型的值调用一个函数。即let a: any;Object.keys(a);会报错
      '@typescript-eslint/no-unsafe-member-access': 'off', // 不允许对类型为any的值进行成员访问。即const a: any = [];console.log(a[0]);会报错
      '@typescript-eslint/no-unsafe-return': 'off', // 不允许从一个函数中返回一个类型为any的值
      '@typescript-eslint/no-unsafe-call': 'off', // 不允许调用any类型的值
      '@typescript-eslint/no-var-requires': 'off', // 即不允许var foo = require('foo');。但是允许import foo = require('foo');
      '@typescript-eslint/restrict-plus-operands': 'off', // 要求加法的两个操作数是相同的类型并且是bigint, number, 或string。即const a = '1';console.log(a + 1);会报错
      '@typescript-eslint/no-non-null-asserted-optional-chain': 'off',
    },
  },
  {
    files: ['**/*.vue'],
    languageOptions: {
      globals: {},
      parser: parserVue,
      parserOptions: {
        ecmaFeatures: {
          jsx: true,
        },
        extraFileExtensions: ['.vue'],
        parser: '@typescript-eslint/parser',
        sourceType: 'module',
      },
    },
    plugins: {
      vue: pluginVue,
    },
    processor: pluginVue.processors['.vue'],
    rules: {
      ...pluginVue.configs.base.rules,
      ...pluginVue.configs['vue3-essential'].rules,
      ...pluginVue.configs['vue3-recommended'].rules,
      'vue/multi-word-component-names': 'off',
    },
  },
]);

console.log(
  '\x1B[0;37;44m INFO \x1B[0m',
  '\x1B[0;;34m ' + `读取了: postcss配置文件` + ' \x1B[0m'
);

// 把.browserslistrc的last 2 version改成last 20 version就可以看到明显效果
// user-select:none
export default {
  plugins: {
    'postcss-preset-env': {},
  },
};

console.log(
  '\x1B[0;37;44m INFO \x1B[0m',
  '\x1B[0;;34m ' + `读取了: prettier配置文件` + ' \x1B[0m'
);

/**
 * @see https://prettier.io/docs/en/configuration.html
 * @type {import("prettier").Config}
 */
const config = {
  bracketSpacing: true, // 默认为true。即要求：{ foo: bar }；可改为false，即要求{foo: bar}
  singleQuote: true, // 默认为false。即要求：const a = "1"；可改为true，即要求const a = '1'
  semi: true, // 默认值true，即要求在所有代码语句的末尾添加分号；可改为false，即要求仅在可能导致 ASI 失败的行的开头添加分号。
  singleAttributePerLine: true, // 默认false。即在HTML、Vue和JSX中不要每行强制执行单个属性；可改为true，即要求每行强制执行单个属性。
  /**
   * jsxBracketSameLine
   * 注意是多行，如果是类似这种：<a>1</a>，基本不会触发换行，因此也就不会触发这个bracketSameLine
   * 但是如果是类似这种：<a a="1 "b="2">1</a>，它有多个属性，或者说他的一个属性值很长，可能会导致换行，
   * 如果换行了，那么就会触发bracketSameLine，将<a a="1 "b="2">最后的>单独放在一行或者最后一行的末尾
   */
  bracketSameLine: false, // 默认为false。即将多行HTML（HTML、JSX、Vue、Angular）元素的 > 单独放在下一行；可改为true，即将 > 放在最后一行的末尾。
  // jsxBracketSameLine: false, // 此选项已在v2.4.0中弃用，使用bracketSameLine替换，https://prettier.io/blog/2021/09/09/2.4.0.html

  /**
   * trailingComma
   * https://developer.mozilla.org/zh-CN/docs/Web/JavaScript/Reference/Trailing_commas
   * 尾后逗号 （有时叫做“终止逗号”）在向 JavaScript 代码添加元素、参数、属性时十分有用。
   * 如果你想要添加新的属性，并且上一行已经使用了尾后逗号，你可以仅仅添加新的一行，而不需要修改上一行。
   * 这使得版本控制的代码比较（diff）更加清晰，代码编辑过程中遇到的麻烦更少。
   */
  trailingComma: 'es5', // 默认值在v2.0.0中none更改为es5。即在ES5中有效的尾随逗号（对象、数组等）。可选："none"：没有尾随逗号；"all"：尽可能尾随逗号

  /**
   * printWidth
   * 如果设置了printWidth值，则以设置的printWidth值为准
   * 如果没有设置printWidth值，且.editorconfig文件有设置max_line_length值，则使用.editorconfig文件的max_line_length
   */
  printWidth: 80, // 默认80，printWidth不是硬性的允许行长度上限，不要试图将 printWidth 当作 ESLint 的max-len 来使用——它们不一样

  /**
   * tabWidth
   * 如果设置了tabWidth值，则以设置的tabWidth值为准
   * 如果没有设置tabWidth值，且.editorconfig文件有设置indent_size或者tab_width值，则使用.editorconfig文件的indent_size或者tab_width
   */
  tabWidth: 2, // 指定每个缩进级别的空格数。
  // parser: 'babel', // 指定要使用的解析器。Prettier 会自动从输入文件路径推断解析器，因此您不必更改此设置。
};

export default config;

import path from 'path';

import vue from '@vitejs/plugin-vue';
import { BilldHtmlWebpackPlugin, logData } from 'billd-html-webpack-plugin';
import externalGlobals from 'rollup-plugin-external-globals';
import autoImport from 'unplugin-auto-import/vite';
import { NaiveUiResolver } from 'unplugin-vue-components/resolvers';
import unpluginVueComponents from 'unplugin-vue-components/vite';
import { defineConfig } from 'vite';
import prefetchPlugin from 'vite-plugin-bundle-prefetch';
import checker from 'vite-plugin-checker';
import { chunkSplitPlugin } from 'vite-plugin-chunk-split';
import eslint from 'vite-plugin-eslint2';
import { createHtmlPlugin } from 'vite-plugin-html';

import pkg from './package.json';

const globals: any = externalGlobals({
  // 'runtime-core': 'runtime-core',
  // vue: 'Vue',
  // 'vue-demi': 'VueDemi',
  // 'vue-router': 'VueRouter',
  'video.js': 'videojs',
  'mpegts.js': 'mpegts',
  // fabric: 'fabric',
  'cos-js-sdk-v5': 'COS',
});

// https://vitejs.dev/config/
export default defineConfig(({ mode }) => {
  const isProduction = mode === 'production';
  const outputStaticUrl = () => {
    if (isProduction) {
      return 'https://live.hsslive.cn/dist/';
    } else {
      return './';
    }
    // return './';
  };

  return {
    base: outputStaticUrl(),
    css: {
      preprocessorOptions: {
        scss: {
          additionalData: `@use 'billd-scss/src/index.scss' as *;@import '@/assets/constant.scss';`,
        },
      },
    },
    resolve: {
      alias: {
        '@': path.resolve(__dirname, 'src'),
        // 'runtime-core':
        //   'https://tencentcos-res.hsslive.cn/npm/@vue/runtime-core@3.5.13/+esm.js',
        // vue: 'https://tencentcos-res.hsslive.cn/npm/vue@3.5.13/+esm.js',
        // 'vue-router': 'https://tencentcos-res.hsslive.cn/npm/vue-router@4.2.4/+esm.js',
        // 'video.js': 'https://tencentcos-res.hsslive.cn/npm/video.js@8.21.0/+esm.js',
        // 'mpegts.js': 'https://tencentcos-res.hsslive.cn/npm/mpegts.js@1.7.3/+esm.js',
        // fabric: 'https://tencentcos-res.hsslive.cn/npm/fabric@5.4.2/+esm.js',
        // 'cos-js-sdk-v5':
        //   'https://tencentcos-res.hsslive.cn/npm/cos-js-sdk-v5@1.8.6/+esm.js',
      },
      /**
       * 不建议省略.vue后缀
       * https://cn.vitejs.dev/config/shared-options.html#resolve-extensions
       */
      // extensions: ['.js', '.ts', '.jsx', '.tsx', '.vue'],
    },
    build: {
      outDir: 'dist',
      rollupOptions: {
        external: [
          // 'vue',
          // 'vue-demi',
          // 'vue-router',
          // 'runtime-core',
          'video.js',
          'mpegts.js',
          // 'fabric',
          'cos-js-sdk-v5',
        ],
        plugins: [globals],
      },
    },
    plugins: [
      // visualizer({
      //   gzipSize: true,
      //   brotliSize: true,
      //   emitFile: false,
      //   filename: 'visualizer.html', // 分析图生成的文件名
      //   open: true, // 如果存在本地服务端口，将在打包后自动展示
      // }),
      chunkSplitPlugin({
        // 指定拆包策略
        // customSplitting: {
        //   // `vue` and `vue-router` 会被打包到一个名为`vue-vendor`的 chunk 里面(包括它们的一些依赖，如 object-assign)
        //   'vue-vendor': [/vue/],
        //   'vue-router-vendor': [/vue-router/],
        //   'av-cliper-vendor': [/@webav\/av-cliper/],
        //   // 源码中 utils 目录的代码都会打包进 `utils` 这个 chunk 中
        //   // utils: [/src\/utils/],
        //   views: [/src\/views/],
        //   compoents: [/src\/compoents/],
        // },
      }),
      prefetchPlugin(),
      // isProduction && legacy(),
      vue(),
      createHtmlPlugin({
        inject: {
          data: {
            // @ts-ignore
            title: 'billd直播',
            // injectScript: `<script src="${outputStaticUrl()}worker.js"></script>`,
          },
          tags: isProduction
            ? [
                {
                  injectTo: 'head',
                  tag: 'script',
                  attrs: {
                    src: 'https://tencentcos-res.hsslive.cn/npm/video.js@8.21.0/video.min.js',
                  },
                },
                {
                  injectTo: 'head',
                  tag: 'script',
                  attrs: {
                    src: 'https://tencentcos-res.hsslive.cn/npm/mpegts.js@1.7.3/mpegts.min.js',
                  },
                },
                {
                  injectTo: 'head',
                  tag: 'script',
                  attrs: {
                    src: 'https://tencentcos-res.hsslive.cn/npm/cos-js-sdk-v5@1.8.6/cos-js-sdk-v5.min.js',
                  },
                },
                // {
                //   injectTo: 'head',
                //   tag: 'script',
                //   attrs: {
                //     src: 'https://tencentcos-res.hsslive.cn/npm/vue@3.5.13/vue.global.min.js',
                //   },
                // },
                // {
                //   injectTo: 'head',
                //   tag: 'script',
                //   attrs: {
                //     src: 'https://tencentcos-res.hsslive.cn/npm/vue-demi@0.14.6/index.iife.min.js',
                //   },
                // },
                // {
                //   injectTo: 'head',
                //   tag: 'script',
                //   attrs: {
                //     src: 'https://tencentcos-res.hsslive.cn/npm/vue-router@4.2.4/vue-router.global.min.js',
                //   },
                // },
              ]
            : [],
        },
      }),
      checker({
        // typescript: true,
        vueTsc: true,
        // eslint: {
        //   lintCommand: 'eslint "./src/**/*.{ts,tsx}"', // for example, lint .ts & .tsx
        // },
      }),
      eslint({}),
      autoImport({
        imports: [
          {
            'naive-ui': ['useMessage', 'useNotification'],
          },
        ],
      }),
      unpluginVueComponents({
        // eslint-disable-next-line
        resolvers: [NaiveUiResolver()],
      }),
      new BilldHtmlWebpackPlugin({ env: 'vite4' }).config,
    ],
    define: {
      'process.env': {
        BilldHtmlWebpackPlugin: logData(null),
        NODE_ENV: JSON.stringify(isProduction ? 'production' : 'development'),
        PUBLIC_PATH: outputStaticUrl(),
        VUE_APP_RELEASE_PROJECT_NAME: JSON.stringify(
          process.env.VUE_APP_RELEASE_PROJECT_NAME
        ),
        VUE_APP_RELEASE_PROJECT_ENV: JSON.stringify(
          process.env.VUE_APP_RELEASE_PROJECT_ENV
        ),
        VUE_APP_RELEASE_PROJECT_VERSION: JSON.stringify(pkg.version),
      },
    },

    server: {
      host: '0.0.0.0',
      proxy: {
        '/api': {
          target: 'http://localhost:4300',
          secure: false, // 默认情况下（secure: true），不接受在HTTPS上运行的带有无效证书的后端服务器。设置secure: false后，后端服务器的HTTPS有无效证书也可运行
          /**
           * changeOrigin，是否修改请求地址的源
           * 默认changeOrigin: false，即发请求即使用devServer的localhost:port发起的，如果后端服务器有校验源，就会有问题
           * 设置changeOrigin: true，就会修改发起请求的源，将原本的localhost:port修改为target，这样就可以通过后端服务器对源的校验
           */
          changeOrigin: true,
          rewrite: (path) => path.replace(/^\/api/, '/'),
        },
        '/betaapi': {
          target: 'http://localhost:4300',
          secure: false, // 默认情况下（secure: true），不接受在HTTPS上运行的带有无效证书的后端服务器。设置secure: false后，后端服务器的HTTPS有无效证书也可运行
          /**
           * changeOrigin，是否修改请求地址的源
           * 默认changeOrigin: false，即发请求即使用devServer的localhost:port发起的，如果后端服务器有校验源，就会有问题
           * 设置changeOrigin: true，就会修改发起请求的源，将原本的localhost:port修改为target，这样就可以通过后端服务器对源的校验
           */
          changeOrigin: true,
          rewrite: (path) => path.replace(/^\/betaapi/, '/'),
        },
        '/prodapi': {
          target: 'http://localhost:4200',
          secure: false, // 默认情况下（secure: true），不接受在HTTPS上运行的带有无效证书的后端服务器。设置secure: false后，后端服务器的HTTPS有无效证书也可运行
          /**
           * changeOrigin，是否修改请求地址的源
           * 默认changeOrigin: false，即发请求即使用devServer的localhost:port发起的，如果后端服务器有校验源，就会有问题
           * 设置changeOrigin: true，就会修改发起请求的源，将原本的localhost:port修改为target，这样就可以通过后端服务器对源的校验
           */
